import Board from './Board';

class Tictactoe extends React.Component{
    constructor(){
        super();
        this.state = {
          squares: Array(36).fill(null),
        }; 
      }
    
       
  handleClick(i){
    console.log(i);
  }

  render(){
    return(
      <div>
        <div className="game"><Board squares={this.state.squares} onClick={i =>{ console.log(1000); this.handleClick(i)} }/></div>
      </div>
    );
  }
}

export default Tictactoe;
